import styled from "styled-components";

export const PerfilUsuarioContainer = styled.div`
	flex: 4;
	padding: 20px;
`;

export const Cabecalho = styled.div`
	display: flex;
	align-items: center;
	justify-content: space-between;
`;

export const BotaoCriar = styled.button`
	width: 80px;
	border: none;
	padding: 5px;
	background-color: teal;
	border-radius: 5px;
	cursor: pointer;
`;
